import { Header } from "./components/Header";

function App() {
  return (
    <div className="bg-bg-img h-screen w-screen bg-cover md:bg-contain">
      <div className="bg-black h-full bg-opacity-25">
        <Header />
        <div className="items-center flex justify-center">
          <h1 className="font-bold">Blogs</h1>
        </div>
      </div>
    </div>
  );
}

export default App;
